(8473, 343, '<p>&nbsp; &nbsp; Manusia pasti memiliki kelenjar keringat yang berjumlah sekitar dua juta. Kelenjar tersebut dapat menghasilkan 2.8 liter keringat setiap hari. Keringat ini dapat menimbulkan bau yang dapat mengganggu kenyamanan. Bau badan disebabkan oleh beberapa faktor. Faktor tersebut berasal dari diri sendiri maupun dari luar.</p>\r\n\r\n<p>&nbsp; &nbsp; Faktor yang berasal dari diri sendiri, yakni berat badan, keadaan emosional, penyakit fisik, dan kegiatan otot. Berat badan seseorang terkadang menentukan jumlah keringat yang keluar, orang yang memiliki berat badan lebih akan mengeluarkan banyak keringat. Orang yang baru emosi atau yang baru melakukan kegiatan otot (misalnya, olahraga) juga mengeluarkan banyak keringat. Keringat yang keluar jika bercampur dengan kuman atau penyakit kulit akan menimbulkan bau yang tidak sedap.</p>\r\n\r\n<p>&nbsp; &nbsp; Faktor dari luar diri sendiri adalah suhu udara luar dan kelembaban udara. Udara yang cukup panas akan memicu seseorang mengelurkan keringat yang banyak.</p>\r\n\r\n<p>Teks di atas termasuk jenis teks&hellip;.</p>\r\n', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(8474, 343, '<p>Imsonia<br />\r\nHampir semua orang pernah mengalami tidak dapat tidur. Kekurangan tidur menyebabkan penurunan kinerja mental dan fisik. Selama tidur merupakan periode REM (rapyd eye movement) yang fungsinya untuk konsolidasi memori. Insomnia sering disebabkan oleh keadaan cuaca, suara bising, cahaya yang terang, penyakit fisik, dan gangguan mental emosional.</p>\r\n\r\n<p><br />\r\nCuaca sangat berpengaruh terhadap seseorang. Jika cuaca sangat ekstrem (sangat panas atau dingin), orang akan banyak mengeluarkan keringat dan mudah emosi karena merasa tidak nyaman. Dalam keadaan seperti ini orang akan sulit tidur.<br />\r\nSelain hal di atas, suara yang bising dan pencahayaan yang sangat terang juga mengganggu kenyamanan seseorang untuk tidur.<br />\r\nSebab-sebab di atas merupakan faktor pemicu insomnia dari luar, sedangkan faktor dari dalam diri adalah penyakit fisik dan gangguan mental emosional.</p>\r\n\r\n<p><br />\r\nPenyakit fisik yang akut atau parah menyebabkan seseorang tidak bisa tidur. Orang yang sedang sakit pasti akan terjaga karena merasakan sakitnya. Gangguan mental juga menyebabkan seseorang susah untuk memejamkan mata. Syaraf-syaraf yang ada di dalam tubuh sulit dikendalikan sehingga tidak bisa memejamkan mata.<br />\r\n<br />\r\nPernyataan umum teks di atas adalah .&hellip;</p>\r\n', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(8475, 343, 'Gempa es disebabkan oleh gletser. Seorang peneliti mempelajari bagaimana gletser membuat gempa es di Antartika. Gempa es tersebut disebabkan oleh gravitasi dan gelombang pasang-surut.<br />Gaya gravitasi menyebabkan aliran Es Whilans tertarik. Tarikan gaya gravitasi menimbulkan daratan es pecah dengan lebar sekitar 96.5 km dan panjang sekitar 482 km ke arah Laut Ross.<br />Gelombang dan pasang mendorong lempeng Es Ross, menghantam gletser yang turun. Gletser terhenti. Saat gelombang surut, es tiba-tiba maju dengan gerakan yang setara dengan gempa berkekuatan 7 pada skala Richter.<br /><br />Teks di atas memiliki struktur….<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(8476, 343, 'Kesuksesan seseorang tidak datang begitu saja. Ada beberapa factor yang mendukung kesuksesan seseorang. Faktor tersebut bisa berasal dari faktor genetik, usaha keras, dan dekat dengan Tuhan.<br />Faktor genetik adalah faktor yang bawaan. Faktor genetik yang mendukung kesuksesan adalah kecerdasan. Walaupun kecerdasan tidak sepenuhnya faktor genetik, tetapi kecerdasan seseorang bisa juga berasal dari bawaan.Orang yang cerdas dapat memahami suatu informasi dengan cepat dan jelas. Selain itu, orang yang cerdas juga kreatif dalam melakukan suatu hal.<br />Kesuksesan juga datang dari usaha keras. Usaha keras diwujudkan dengan pantang menyerah. Ketika menghadapi suatu cobaan, tidak putus asa tetapi berusaha untuk mencari solusi.<br />Kesuksesan bisa diraih jika dekat dengan Tuhan. Orang yang sukses tentunya orang yang selalu mendekatkan dirinya kepada Tuhan. Orang yang selalu berdoa dan bersyukur kepada Tuhan.<br /><br />Sebab-akibat teks di atas, kecuali….<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(8477, 343, 'ADHD (attention Deficite Hyperactivity Disorder) merupakan gangguan kesehatan jiwa yang sering terjadi pada anak. ADHD ini disebabkan oleh kerusakan ringan pada struktur otak, kurangnya aktivitas di daerah frontal otak, dan faktor keturunan.<br />Otak terdiri dari otak besar dan otak kecil. Belahan-belahan otak tersebut dihubungkan oleh neuron. Pada penderita ADHD, neuron penghubung otak tersebut rusak sehingga penderita tidak dapat menafsirkan makna atau gerakan sehingga mereka kurang focus dan berlari ke jalanan tanpa melihat sekelilingnya.<br />Pada penderita ADHD, daerah yang mengendalikan ingatan (memori) dan emosi berukuran lebih kecil daripada orang normal. Hal ini menyebabkan penderita ADHD sering kehilangan atau melupakan sesuatu, kurang sadar, dan mudah emosi.<br />Penderita ADHD, terkadang berasal dari gen atau keturunan. Walaupun tidak semua penderita ADHD merupakan keturunan penderita, tetapi faktor keturunan juga memicu seseorang menderita ADHD.<br /><br />Perhatikan pernyataan berikut ini!<br />1. Teks tersebut terdapat unsur sebab-akibat.<br />2. Teks tersebut memiliki struktur pernyataan umum ^ aspek yang dilaporkan.<br />3. Teks tersebut memberikan penjelasan.<br />4. Teks di atas merupakan teks observasi.<br /><br />Pernyataan yang benar adalah….<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
