(8488, 343, 'Cermatilah teks berikut.        <br /><br />Untuk mematikan komputer, Anda dapat mengeklik tombol start. Kemudian pilih shutdown. Dengan menekan shutdown, komputer akan mati secara otomatis. Setelah program komputer hilang, tekanlah tombol power pada layar monitor dan stabilizer saluran listrik. Cabutlah steker listrik ke komputer untuk mengakhiri proses operasi komputer<br /><br />Teks di atas merupakan teks .... <br /><br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(8489, 343, '<p>Cermatilah kalimat-kalimat berikut.<br />\r\n<br />\r\n1) Selain itu, keyboard ini dapat juga digunakan untuk desktop PC (personal computer) atau laptop.<br />\r\n<br />\r\n2) Dengan menggunakan teknologi sinar laser dan infra merah, keyboard ini sangat berguna bagi setiap pengguna PDA.<br />\r\n<br />\r\n3) Sekarang telah lahir Virtual Laser Keyboard, keyboard canggih yang telah lama ditunggu-tunggu.<br />\r\n<br />\r\nUrutan yang tepat paragraf prosedur di atas adalah&hellip;.<br />\r\n&nbsp;</p>\r\n', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(8490, 343, '<p>Cermatilah kalimat-kalimat berikut.<br />\r\n<br />\r\n1. Setelah itu, diletakkan dalam sebuah wadah, diberi ragi dan terkadang diberi sedikit gula untuk mempermanis rasanya.<br />\r\n2. Selain dari beras ketan, tape tebuat dari singkong yang telah dikupas kemudian direbus.<br />\r\n3. Hal ini bertujuan agar terjadi fermentasi.<br />\r\n4. Pemberian ragi hendaknya rata.<br />\r\n5. Langkah terakhir menutup tape yang beragi dan diberi gula tadi dengan daun pisang serta penutup berupa kain hingga rapat.<br />\r\n6. Setelah + 3 hari, singkong telah berubah menjadi tape yang enak rasanya dan siap disantap<br />\r\n7. Selanjutnya tape diitutup selama + 3 hari dan tidak boleh dalam selang waktu tersebut, penutupnya dibuka.</p>\r\n\r\n<p>Urutan yang tepat paragraf prosedur di atas adalah&hellip;.<br />\r\n&nbsp;</p>\r\n', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(8491, 343, 'Perhatikan wacana berikut dengan cermat! <br /><br />Di Indonesia banyak pengendara kendaraan bermotor. Jika pengendara melakukan pelanggaran, tentu pihak berwajib akan menilangnya. Pengendara kendaraan bermotor perlu mengetahui prosedur penilangan. Berikut ini hal yang harus Anda perhatikan ketika dikenakan surat bukti pelanggaran, Anda tidak akan dirugikan dan akan mendapat sanksi sesuai dengan peraturan. <br /><br />Kalimat yang menyatakan tujuan terdapat dalam kalimat berikut ….<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
