(9127, 295, 'Perhatikan pernyataan berikut!<br />(1) Pengendalian gelombang-gelombang pikiran dalam alam pikiran untuk dapat berhubungan dengan Hyang Widhi<br />(2) Yogascitta Vrttinirodah adalah proses penyatuan dengan Sang Hyang Widhi secara terus menerus<br />(3) Ilmu yang mengajarkan tentang pengendalian pikiran dan badan untuk mencapai tujuan terakhir yang disebut Samadhi<br />(4) 8 tahapan atau cara untuk menyatukan diri dengan Sang Hyang Widhi Wasa<br />(5) Melatih kekuatan tubuh agar sehat jasmani dan rohani<br />Dari pernyataan tersebut manakah pengertian yoga…<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(9128, 295, 'Bangsa yang besar adalah bangsa yang menghargai, menghormti pendahulunya dan sejarahnya. Kehadiran ajaran yoga di kalangan umat Hindu sudah sangat popular, bahkan yang merambah masyarakat pada umumnya. Adapun orang cusi yang membangun dan mengembangkan ajaran yoga adalah…', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
