(9130, 295, 'Perhatikan pernyataan berikut!<br />(1) Samadhipada   (3) Vibutipada   (5) Karmapada<br />(2) Sadhanapada   (4) Kaivalyapada<br />Kitab yang menjelaskan tentang alam kelepasan dan kenyataan roh dalam mengatasi alam duniawi adalah …..<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(9131, 295, 'Tuhan sebagai penolong, Tuhan sebagai penyelamat, Tuhan Maha Kuasa, Tuhan Tuhan sebagai penolong yang dipuja dengan gembira dalam setiap pemujaan, Tuhan Maha Kuasa, selalu dipuja, kami memohon semoga Tuhan Yang Maha Pemurah melimpahkan rahmat kepada kami. Arti sloka ini terdapat pada kitab ….', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(9132, 295, ' Perhatikan pernyataan berikut!<br />(1) Gerakan Yoga yang dilakukan dengan posisi fisik Asana, teknik pernapasan (pranayama) disertai dengan meditasi<br />(2) GerakanYoga yang dilaksanakan dengan mengucapkan kalimat-kalimat suci melalui rasa kebaktian dan perhatian yang terkonsentrasi<br />(3) Gerakan Yoga yang dilakukan dengan tujuan menundukkkan pembangkitan daya kekuatan kreatif kundalini yang mengandung latihan mental dan jasmani<br />(4) Gerakan Yoga yang memfokuskan diri menuju hati, yang membuat seseorang menjadi welas asih dan menerima segala yang ada di sekitarnya<br />(5) Gerakan Yoga yang menitik beratkan pada teknik meditasi dan kontemplasi<br />Dari pernyataan tersebut gerakan yoga yang dilakukan dengan tujuan memfokuskan diri menuju hati yang membuat seseorang menjadi welas asih dan menerima segala yang ada di sekitarnya disebut….<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
