(9134, 295, '<p>Perhatikan pernyataan berikut!</p>\r\n\r\n<ol>\r\n	<li>&nbsp;Yama</li>\r\n	<li>&nbsp;Niyama</li>\r\n	<li>&nbsp;Asana</li>\r\n	<li>Pranayama</li>\r\n	<li>&nbsp;Prathyahara</li>\r\n	<li>Dharana</li>\r\n	<li>Dhyana</li>\r\n	<li>Samadhi</li>\r\n</ol>\r\n\r\n<p>Tahapan-tahapan dalam pelaksanaan etika Yoga diatas disebut &hellip;.</p>\r\n', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
