(9140, 295, 'Yoga merupakan ajaran agama Hindu yang telah berkembang sejak ribuan tahun yang lalu di India. Ajaran ini dikembangkan oleh Rsi Patanjali. Di era modern abad 21 ajaran yoga juga dipelajari oleh orang non Hindu, biasanya digunakan untuk kesehatan. Di kalangan umat Hindu telah diyakini yoga merupakan salah satu cara yang dilakukan untuk mencapai kelepasan atau Moksa. Untuk mencapai kebebasan dengan jalan yoga, seseorang harus memusatkan pikiran.<br />Dalam ajaran Astangga Yoga disebut....<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
