(9147, 295, '<p>Perhatikan pernyataan berikut!<br />\r\n1. Dapat menopang tubuh dalam jangka waktu lama,<br />\r\n2. Memberikan efek ketenangan pada jaringan araf dan mengendalikan fungsi seksual<br />\r\n3. Membasmi bermacam penyakit seperti asma, paru-paru, bronchitis<br />\r\n4. Menguatkan penceranaan, membetulkan penceranaandan salah perut seperti perut kembung<br />\r\n5. Menghilangkan hawa nafsu, tamas, dan menghilangkan lemak</p>\r\n\r\n<p>Manfaat gerakan yoga asanas padmasana ditunjukkan oleh pernyataan nomor&hellip;</p>\r\n', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
