(9488, 346, 'Berikut ini adalah langkah-langkah yang dilakukan sebagai warga negara yang baik untuk menghidarkan diri dari kasus-kasus pelanggaran ham. <br />1) Menghormati dan menyayangi anggota keluarga<br />2) Mematuhi perintah dan nasehat orang tua<br />3) Melindungi teman yang dianiaya<br />4) Menghargai hasil karya teman di sekolah<br />5) Menasehati teman yang melakukan kesalahan<br />6) Berbakti kepada orang tua<br />7) Tidak melakukan perbuatan yang adapat mencemarkan nama baik keluarga<br />8) Membuang sampah pada tempatnya<br />9) Mematuhi norma dan aturan yang berlaku di masyarakat<br />10) Menghargai hasil keputusan keluarga<br />Manakah langkah yang harus dilakukan guna membangun harmonisasi hak dan kewajiban asasi manusia di lingkungan keluarga...<br />', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
(9489, 346, 'Demokrasi yang didasarkan pada kebebasan individualisme yaitu demokrasi yang mencita-citakan tercapainya pemerintahan yang tunduk kepada hukum. Ciri khas demokrasi ini adalah pemberian kebebasan seluas-luasnya kepada individu dan pemerintah hanya tunduk terhadap konstitusi  saja  demokrasi ini dianut oleh negara Amerika serikat adalah...', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
