(9605, 303, '<p>Di bawah ini merupakan pernyataan tentang masalah ekonomi yang dihadapi oleh individu atau kelompok masyarakat dalam memenuhi kebutuhan.</p>\r\n\r\n<p>1) Barang apa yang akan diproduksi oleh suatu masyarakar dan berapa jumlahnya.<br />\r\n2) Sulit mendapatkan ekspor karena keterbatasan sumber daya produksi<br />\r\n3) Sangat sulit melepaskan masyarakat dari kemiskinan.<br />\r\n4) Untuk siapa barang diproduksi, apakah untuk kelompok orang berpenghasilan tinggi atau&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; sekelompok masyarakat yang tidak mampu.<br />\r\n5) Bagaimana cara memproduksi suatu barang agar bermutu dan memenuhi kebutuhan.</p>\r\n\r\n<p>Pernyataan yang merupakan masalah pokok perekonomian adalah ....<br />\r\n&nbsp;</p>\r\n', 1, NULL, 1, 1, NULL, 0, NULL, 0, 0),
