(10431, 335, '<p style=\"text-align:center\">Kompleks Segitiga B7</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;&nbsp;&nbsp; Kampung Genting</p>\r\n\r\n<p style=\"text-align:center\">Jakarta</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">20 Mei 2016</p>\r\n\r\n<p style=\"text-align:justify\">Mr. Pandia Arif</p>\r\n\r\n<p style=\"text-align:justify\">Internship Program</p>\r\n\r\n<p style=\"text-align:justify\">PT Radio Perkasindo</p>\r\n\r\n<p style=\"text-align:justify\">Jakarta</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Dear Mr. Pandia,</p>\r\n\r\n<p style=\"text-align:justify\">I am a seventeen-year-old high school student interested in the internship with Media Relations Department in Radio Kita, a part of PT Radio Perkasindo which cater to people of my age, during school holiday in June-August 2016.</p>\r\n\r\n<p style=\"text-align:justify\">During school holiday, Radio Kita has many youth program ranging from arts, sport, and science. The programs are similar to what I have managed when I acted as the managing director of Artfest in SMA Genting in 2015 and the event coordinator of Jakarta Youth Sport earlier this January. I believe I can use my experiences to contribute to your events. Moreover, as I am your target market. I would be the suitable person to give you insight about young people. For me, it will be a special experience as it would be my first time working with professionals.</p>\r\n\r\n<p style=\"text-align:justify\">Even thought I am still in high school, I have experiences that is only limited to few and great interests in your field. I am a strong intern candidate and I am looking forward to attending an interview with you. Thank you for your time</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Best Regards,</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Kurniawati</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>What does the applicant offer?</p>\r\n\r\n<p>A. Communication skills</p>\r\n\r\n<p>B. Good team work</p>\r\n\r\n<p>C. Related experiences</p>\r\n\r\n<p>D. Language proficiency</p>\r\n\r\n<p>E. Journalistic skills</p>\r\n', 3, 'C', 1, 1, NULL, 0, NULL, 0, 0),
(10432, 335, '<p style=\"text-align:center\">Kompleks Segitiga B7</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;&nbsp;&nbsp; Kampung Genting</p>\r\n\r\n<p style=\"text-align:center\">Jakarta</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">20 Mei 2016</p>\r\n\r\n<p style=\"text-align:justify\">Mr. Pandia Arif</p>\r\n\r\n<p style=\"text-align:justify\">Internship Program</p>\r\n\r\n<p style=\"text-align:justify\">PT Radio Perkasindo</p>\r\n\r\n<p style=\"text-align:justify\">Jakarta</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Dear Mr. Pandia,</p>\r\n\r\n<p style=\"text-align:justify\">I am a seventeen-year-old high school student interested in the internship with Media Relations Department in Radio Kita, a part of PT Radio Perkasindo which cater to people of my age, during school holiday in June-August 2016.</p>\r\n\r\n<p style=\"text-align:justify\">During school holiday, Radio Kita has many youth program ranging from arts, sport, and science. The programs are similar to what I have managed when I acted as the managing director of Artfest in SMA Genting in 2015 and the event coordinator of Jakarta Youth Sport earlier this January. I believe I can use my experiences to contribute to your events. Moreover, as I am your target market. I would be the suitable person to give you insight about young people. For me, it will be a special experience as it would be my first time working with professionals.</p>\r\n\r\n<p style=\"text-align:justify\">Even thought I am still in high school, I have experiences that is only limited to few and great interests in your field. I am a strong intern candidate and I am looking forward to attending an interview with you. Thank you for your time</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Best Regards,</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Kurniawati</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>What position does the applicant apply to?</p>\r\n\r\n<p>A. Interns</p>\r\n\r\n<p>B. Disk jockey</p>\r\n\r\n<p>C. Radio operator</p>\r\n\r\n<p>D.Test engineer</p>\r\n\r\n<p>E. Customer service</p>\r\n', 3, 'A', 1, 1, NULL, 0, NULL, 0, 0),
(10433, 335, '<p style=\"text-align:center\">Kompleks Segitiga B7</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;&nbsp;&nbsp; Kampung Genting</p>\r\n\r\n<p style=\"text-align:center\">Jakarta</p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\">20 Mei 2016</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Mr. Pandia Arif</p>\r\n\r\n<p style=\"text-align:justify\">Internship Program</p>\r\n\r\n<p style=\"text-align:justify\">PT Radio Perkasindo</p>\r\n\r\n<p style=\"text-align:justify\">Jakarta</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Dear Mr. Pandia,</p>\r\n\r\n<p style=\"text-align:justify\">I am a seventeen-year-old high school student interested in the internship with Media Relations Department in Radio Kita, a part of PT Radio Perkasindo which cater to people of my age, during school holiday in June-August 2016.</p>\r\n\r\n<p style=\"text-align:justify\">During school holiday, Radio Kita has many youth program ranging from arts, sport, and science. The programs are similar to what I have managed when I acted as the managing director of Artfest in SMA Genting in 2015 and the event coordinator of Jakarta Youth Sport earlier this January. I believe I can use my experiences to contribute to your events. Moreover, as I am your target market. I would be the suitable person to give you insight about young people. For me, it will be a special experience as it would be my first time working with professionals.</p>\r\n\r\n<p style=\"text-align:justify\">Even thought I am still in high school, I have experiences that is only limited to few and great interests in your field. I am a strong intern candidate and I am looking forward to attending an interview with you. Thank you for your time</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Best Regards,</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Kurniawati</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>What is the purpose of the letter?</p>\r\n\r\n<p>A. To express your interest in applying for a position</p>\r\n\r\n<p>B. To introduce yourself to a company or institution that you are interested in</p>\r\n\r\n<p>C. To maintain relationship with your colleagues</p>\r\n\r\n<p>D. To create business relationship with a company</p>\r\n\r\n<p>E. To resign from a position that you are in</p>\r\n', 3, 'A', 1, 1, NULL, 0, NULL, 0, 0);
